from samson.prngs.pcg import PCG
import unittest

# Test vectors manually generated from reference code
class PCGTestCase(unittest.TestCase):
    # Reference code

    # #include <stdint.h>
    # #include <stdio.h>
    # #include <inttypes.h>

    # static uint64_t       state      = 0x4d595df4d0f33173;		// Or something seed-dependent
    # static uint64_t const multiplier = 6364136223846793005u;
    # static uint64_t const increment  = 1442695040888963407u;	// Or an arbitrary odd constant

    # static uint32_t rotr32(uint32_t x, unsigned r)
    # {
    #     return x >> r | x << (-r & 31);
    # }

    # uint32_t pcg32(void)
    # {
    #     uint64_t x = state;
    #     unsigned count = (unsigned)(x >> 59);		// 59 = 64 - 5
    #     // printf("count %" PRIu64 "\n", count);

    #     state = x * multiplier + increment;
    #     // printf("state %" PRIu64 "\n", state);
    #     x ^= x >> 18;								// 18 = (64 - 27)/2
    #     return rotr32((uint32_t)(x >> 27), count);	// 27 = 32 - 5
    # }

    # void pcg32_init(uint64_t seed)
    # {
    #     state = seed + increment;
    #     (void)pcg32();
    # }


    # int main( int argc, const char* argv[] )
    # {
    #     //pcg32_init(state);
    #     for(int i=0; i < 1000; i++) {
    #         printf("%" PRIu64 ", ", pcg32());
    #     }
    # }

    def _run_test(self, seed, multiplier, increment, expected_results):
        pcg = PCG(seed=seed, multiplier=multiplier, increment=increment)
        self.assertEqual([pcg.generate() for _ in range(len(expected_results))], expected_results)


